import './ExpenseItem.css'

function ExpenseItem() {
  const ExpenseDate = new Date(2021,2,28);
  const expenseTitle = "Car Insurance";
  const expenseAmount = 294.78;

  return (
    <div>
      <div>Date</div>
      <div>Title</div>
      <h2>${expenseTitle}</h2>
      <div>Amount</div>
    </div>
  );
}

export default ExpenseItem;
